class Solution(object):
    def firstMissingPositive(self, nums):
        """
        :type nums: List[int]
        :rtype: int
        """

        # 1. mark all negative numbers and all numbers larger than nums.length as 0
        # 2. mark all numbers in nums as 1
        # 3. iterate through nums and mark the corresponding number as -1
        # 4. iterate through nums again and return the first number that is not marked as -1

        n = len(nums)
        for i in range(n):
            if nums[i] <= 0:
                nums[i] = n + 1

        for i in range(n):
            num = abs(nums[i])
            if num <= n:
                nums[num - 1] = -abs(nums[num - 1])

        for i in range(n):
            if nums[i] > 0:
                return i + 1

        return n + 1

