class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def dfs(i, curr, prev, res):
            if i == len(num):
                if curr == target:
                    res.append(prev)
                return
            for j in range(i, len(num)):
                if j > i and num[i] == '0':
                    break
                curr_num = int(num[i:j+1])
                if prev == 0:
                    dfs(j+1, curr_num, curr_num, res)
                else:
                    dfs(j+1, curr + prev, curr_num, res)
                    dfs(j+1, prev - curr, -curr_num, res)
                    dfs(j+1, prev * curr, curr_num, res)

        res = []
        dfs(0, 0, 0, res)
        return res

