class Solution(object):
    def maxNumber(self, nums1, nums2, k):
        """
        :type nums1: List[int]
        :type nums2: List[int]
        :type k: int
        :rtype: List[int]
        """

        def pick(nums, k):
            removed = len(nums) - k
            out = []
            for num in nums:
                while removed and out and out[-1] < num:
                    out.pop()
                    removed -= 1
                out.append(num)
            return out

        def merge(nums1, nums2):
            out = []
            i, j = 0, 0
            while i < len(nums1) and j < len(nums2):
                if nums1[i] > nums2[j]:
                    i += 1
                else:
                    j += 1
                out.append(nums1[i] if i < len(nums1) else nums2[j])
            return out

        return max(merge(pick(nums1, i), pick(nums2, k - i)) for i in range(k + 1) if i <= len(nums1) and k - i <= len(nums2))

