        :type nums: List[int]
        :rtype: int
        """

        def merge(nums, left, mid, right):
            count = 0
            j = mid + 1
            for i in range(left, mid + 1):
                while j <= right and nums[i] > 2 * nums[j]:
                    j += 1
                count += j - (mid + 1)
            i = left
