        """
        :type beginWord: str
        :type endWord: str
        :type wordList: List[str]
        :rtype: List[List[str]]
        """

        # build graph
        graph = collections.defaultdict(list)
        for word in wordList:
            for i in range(len(word)):
                graph[word[:i] + "*" + word[i+1:]].append(word)

        # build queue and visited
        queue = collections.deque([beginWord])
        visited = {beginWord: None}

        # build result
        result = []
        while queue:
            # get current level
            level = []
            for _ in range(len(queue)):
                word = queue.popleft()
                if word == endWord:
                    path = [endWord]
                    while path[0] != beginWord:
                        path.append(visited[path[0]])
                    result.append(path[::-1])
                for i in range(len(word)):
                    for neighbor in graph[word[:i] + "*" + word[i+1:]]:
                        if neighbor not in visited:
                            visited[neighbor] = word
                            queue.append(neighbor)
                            level.append(neighbor)
            if not level:
                return []
            if endWord not in level:
                return []
            graph.clear()
            for word in level:
                for i in range(len(word)):
                    for neighbor in graph[word[:i] + "*" + word[i+1:]]:
                        graph[neighbor].append(word)

