        return self.binary_search(nums, target, pivot + 1, len(nums) - 1)

    def find_pivot(self, nums):
        left, right = 0, len(nums) - 1

        while left < right:
            mid = left + (right - left) // 2

            if nums[mid] > nums[right]:
                left = mid + 1
            else:
                right = mid

        return left

    def binary_search(self, nums, target, left, right):
        while left <= right:
            mid = left + (right - left) // 2

